import React from 'react';

const NextQuestion = ({next, questionIndex, length}) => {

	return (
		questionIndex === length ? 
			<button onClick={next}>Finish</button> :
			<button onClick={() => next()} >
				Next Question
			</button> 

	);
}

export default NextQuestion;
